	            <h1 class="display-4" style="color: white">Indiaâ€™s Swiggy to cut 1,100 jobs, scale down cloud kitchen operations</h1>
	            <p class="lead">By Manish Singh on 16 July 2020 10:15 PM</p>
	          </center>
