	         <div class="container" style="background: white; width: 80%; margin-left: 10%; padding-top: 30px;">
	            
        
        <p id="speakable-summary" style="box-sizing: inherit; margin: 15px 0px; background-repeat: no-repeat; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: -0.1px;"><a class="crunchbase-link" href="https://crunchbase.com/organization/swiggy" target="_blank" data-type="organization" data-entity="swiggy" style="box-sizing: inherit; color: rgb(0, 165, 98); background-repeat: no-repeat; touch-action: manipulation; border-bottom: 1px solid rgb(0, 165, 98); transition: color 0.1s ease 0s; font-weight: 700;">Swiggy&nbsp;<span class="crunchbase-tooltip-indicator" style="box-sizing: inherit; background: linear-gradient(315deg, rgb(0, 211, 1), rgb(54, 194, 117) 50.5%, rgb(0, 165, 98)); display: inline-block; vertical-align: baseline; font-size: 14px; line-height: 16px; height: 1em; width: 1em; margin-left: -1px; border-radius: 0.5em; color: rgb(255, 255, 255); text-align: center; transition: background 0.1s ease 0s;"></span></a>&nbsp;said on Monday it is cutting 1,100 jobs and scaling down some adjacent businesses as Indiaâ€™s top food delivery startup looks to reduce costs to survive the coronavirus pandemic that has made people cautious about ordering food online.</p><p style="box-sizing: inherit; margin: 15px 0px; background-repeat: no-repeat; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: -0.1px;">In an internal email, which the Bangalore-headquartered startup&nbsp;<a href="https://blog.swiggy.com/news-updates/changes-were-making-to-adapt-to-the-times" style="box-sizing: inherit; color: rgb(0, 165, 98); background-repeat: no-repeat; touch-action: manipulation; border-bottom: 1px solid rgb(241, 241, 241); transition: color 0s ease 0s, border-color 0.2s linear 0s;">published</a>&nbsp;on its blog, Swiggy co-founder and chief executive Sriharsha Majety said the startupâ€™s core food business had been â€˜severely impacted.â€™</p><p style="box-sizing: inherit; margin: 15px 0px; background-repeat: no-repeat; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: -0.1px;">The startup, which employed about 8,000 people late last year, is currently processing fewer than a million orders a day on its platform, down from nearly 3 million it was handling before the outbreak, people familiar with the matter told TechCrunch.</p><p style="text-align: center; box-sizing: inherit; margin: 15px 0px; background-repeat: no-repeat; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: -0.1px;"><img style="width: 80%" src="data:image/jpeg;base64,"><br></p><div class="piano-inline-promo" style="box-sizing: inherit; background-repeat: no-repeat; clear: both; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: -0.1px;"></div><p style="box-sizing: inherit; margin: 15px 0px; background-repeat: no-repeat; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: -0.1px;">To cut costs, Swiggy said it would be eliminating 1,100 jobs â€œacross grades and functions in the cities and head officeâ€ over the next few days. The company, backed by Prosus Ventures, said it will provide those affected with three months of salary, with one additional month for each year they have spent at the startup.</p><p style="box-sizing: inherit; margin: 15px 0px; background-repeat: no-repeat; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: -0.1px;">It will also provide those being let go with medical and accident coverage until the end of the year, and counseling for mental, emotional, and financial stress throughout the same period.</p><p style="box-sizing: inherit; margin: 15px 0px; background-repeat: no-repeat; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: -0.1px;">â€œThis is easily the hardest and longest deliberated decision the management team and I have been faced with over recent times. We have been fortunate to have some of the brightest missionary talent in the country join us over the last few years, and I would like to state unequivocally that this is not at all a reflection of anyoneâ€™s performance,â€ wrote Majety.</p><p style="box-sizing: inherit; margin: 15px 0px; background-repeat: no-repeat; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: -0.1px;">TechCrunch, as well as Indian newspaper Economic Times and outlet Entrackr, reported in late April that the startup was<a href="https://techcrunch.com/2020/04/21/indian-food-delivery-startup-swiggy-is-cutting-jobs/" style="box-sizing: inherit; color: rgb(0, 165, 98); background-repeat: no-repeat; touch-action: manipulation; border-bottom: 1px solid rgb(241, 241, 241); transition: color 0s ease 0s, border-color 0.2s linear 0s;">&nbsp;cutting about 1,000 jobs</a>, mostly in the cloud kitchen category. Swiggy had confirmed the layoff at the time, but did not share a number.</p><p style="box-sizing: inherit; margin: 15px 0px; background-repeat: no-repeat; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: -0.1px;">A Swiggy spokesperson did not immediately share whether todayâ€™s announcement represents the same job cuts. A person familiar with the matter told TechCrunch today that Mondayâ€™s 1,100 job cuts primarily affect those in non-cloud kitchen parts of the business.</p><p style="box-sizing: inherit; margin: 15px 0px; background-repeat: no-repeat; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; letter-spacing: -0.1px;">Mondayâ€™s announcement follows a similar move by&nbsp;<a class="crunchbase-link" href="https://crunchbase.com/organization/zomato" target="_blank" data-type="organization" data-entity="zomato" style="box-sizing: inherit; color: rgb(51, 51, 51); background-repeat: no-repeat; touch-action: manipulation; border-bottom: 1px solid rgb(241, 241, 241); transition: color 0.1s ease 0s; font-weight: 700;">Zomato,&nbsp;<span class="crunchbase-tooltip-indicator" style="box-sizing: inherit; background: rgb(170, 170, 170); display: inline-block; vertical-align: baseline; font-size: 14px; line-height: 16px; height: 1em; width: 1em; margin-left: -1px; border-radius: 0.5em; color: rgb(255, 255, 255); text-align: center; transition: background 0.1s ease 0s;"></span></a>&nbsp;the No. 2 food delivery startup in India which said last week it was&nbsp;<a href="https://techcrunch.com/2020/05/15/indian-food-delivery-startup-zomato-cuts-13-of-workforce/" style="box-sizing: inherit; color: rgb(0, 165, 98); background-repeat: no-repeat; touch-action: manipulation; border-bottom: 1px solid rgb(241, 241, 241); transition: color 0s ease 0s, border-color 0.2s linear 0s;">reducing its global workforce by 13%, or about 520 people</a>.</p>            
